import React from 'react'
import 'bootstrap/dist/css/bootstrap.css';

const Contact = () => {
  return (
    <div className='container'>
      <nav className="nav-pills navbar navbar-expand-lg navbar-light bg-light">
      <a class="navbar-brand" href="#">h1</a>
      <a class="navbar-brand" href="#">h2</a>
      <a class="navbar-brand" href="#">h3</a>
      </nav>
    </div>
  )
}

export default Contact
